import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Login from './components/Login';
import User from './components/User';
import Admin from './components/Admin';
import Documents from './components/Documents';
import DocumentAnalysis from './components/DocumentAnalysis';
import AdminPanel from './components/AdminPanel';
import './App.css';

// –í—ã–≤–æ–¥–∏–º URL –¥–ª—è –¥–æ—Å—Ç—É–ø–∞ —Å –¥—Ä—É–≥–∏—Ö —É—Å—Ç—Ä–æ–π—Å—Ç–≤ –≤ –ª–æ–∫–∞–ª—å–Ω–æ–π —Å–µ—Ç–∏
const printNetworkUrl = () => {
  try {
    // –ü–æ–ª—É—á–∞–µ–º —Ç–µ–∫—É—â–∏–π hostname (–æ–±—ã—á–Ω–æ localhost –∏–ª–∏ 127.0.0.1)
    const hostname = window.location.hostname;
    
    // –ï—Å–ª–∏ —Å–µ—Ä–≤–µ—Ä –∑–∞–ø—É—â–µ–Ω –ª–æ–∫–∞–ª—å–Ω–æ, –∑–∞–º–µ–Ω—è–µ–º –Ω–∞ IP (—á—Ç–æ–±—ã —Ä–∞–±–æ—Ç–∞–ª–æ —Å –¥—Ä—É–≥–∏—Ö —É—Å—Ç—Ä–æ–π—Å—Ç–≤)
    const isLocalhost = hostname === 'localhost' || hostname === '127.0.0.1';
    const networkIp = getNetworkIp(); // –ü—ã—Ç–∞–µ–º—Å—è –ø–æ–ª—É—á–∏—Ç—å –ª–æ–∫–∞–ª—å–Ω—ã–π IP
    
    const port = window.location.port || (window.location.protocol === 'https:' ? 443 : 80);
    const protocol = window.location.protocol;
    
    if (isLocalhost && networkIp) {
      console.log(
        `üåê –î–æ—Å—Ç—É–ø–Ω–æ –≤ –ª–æ–∫–∞–ª—å–Ω–æ–π —Å–µ—Ç–∏ –ø–æ –∞–¥—Ä–µ—Å—É:\n${protocol}//${networkIp}:${port}`
      );
    } else {
      console.log(
        `üñ•Ô∏è  –õ–æ–∫–∞–ª—å–Ω—ã–π –∞–¥—Ä–µ—Å:\n${protocol}//${hostname}${port ? `:${port}` : ''}`
      );
    }
  } catch (error) {
    console.warn('–ù–µ —É–¥–∞–ª–æ—Å—å –æ–ø—Ä–µ–¥–µ–ª–∏—Ç—å —Å–µ—Ç–µ–≤–æ–π IP:', error);
  }
};

// –ü—ã—Ç–∞–µ–º—Å—è –ø–æ–ª—É—á–∏—Ç—å –ª–æ–∫–∞–ª—å–Ω—ã–π IP (–Ω–µ –≤—Å–µ–≥–¥–∞ –≤–æ–∑–º–æ–∂–Ω–æ –≤ –±—Ä–∞—É–∑–µ—Ä–µ)
const getNetworkIp = () => {
  // –í –±—Ä–∞—É–∑–µ—Ä–µ –Ω–µ–ª—å–∑—è –Ω–∞–ø—Ä—è–º—É—é —É–∑–Ω–∞—Ç—å IP, –Ω–æ –º–æ–∂–Ω–æ –ø–æ–ø—Ä–æ–±–æ–≤–∞—Ç—å —á–µ—Ä–µ–∑ WebRTC (–Ω–µ –≤—Å–µ–≥–¥–∞ —Ä–∞–±–æ—Ç–∞–µ—Ç)
  return null; // –í —Ä–µ–∞–ª—å–Ω–æ—Å—Ç–∏ –∑–¥–µ—Å—å –º–æ–∂–µ—Ç –±—ã—Ç—å —Å–ª–æ–∂–Ω–∞—è –ª–æ–≥–∏–∫–∞, –Ω–æ –≤ –±—Ä–∞—É–∑–µ—Ä–µ —ç—Ç–æ –æ–≥—Ä–∞–Ω–∏—á–µ–Ω–æ
};

// –í—ã–∑—ã–≤–∞–µ–º –ø—Ä–∏ –∑–∞–≥—Ä—É–∑–∫–µ
printNetworkUrl();

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/user" element={<User />} />
          <Route path="/admin" element={<Admin />} />
          <Route path="/documents" element={<Documents />} />
          <Route path="/analysis" element={<DocumentAnalysis />} />
          <Route path="/admin-panel" element={<AdminPanel />} />
          <Route path="/" element={<Navigate to="/login" replace />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
